function setMove(x1, y1, x2, y2, anpha) {
    x = x2 - x1;
    y = y2 - y1;
    if (x < 0) {
        var xNew = x2 - anpha;
        if (y < 0) {
            var yNew = y2 - (anpha * (y1 - y2)) / (x1 - x2);
            return { x: xNew, y: yNew };
        } else if (y == 0) {
            var yNew = y2;
            xNew = x2 - 2 * anpha;
            return { x: xNew, y: yNew };
        } else {
            var yNew = y2 + (anpha * (y2 - y1)) / (x1 - x2);
            return { x: xNew, y: yNew };
        }
    } else if (x == 0) {
        var xNew = x1;
        if (y < 0) {
            var yNew = y2 - 3 * anpha;
            return { x: xNew, y: yNew };
        } else if (y == 0) {
            var yNew = y2;
            return { x: xNew, y: yNew };
        } else {
            var yNew = y2 - anpha;
            return { x: xNew, y: yNew };
        }
    } else {
        var xNew = x2 + anpha;
        if (y < 0) {
            var yNew = y2 - (anpha * (y1 - y2)) / (x2 - x1);
            return { x: xNew, y: yNew };
        } else if (y == 0) {
            var yNew = y2;
            xNew = x2 + 2 * anpha;
            return { x: xNew, y: yNew };
        } else {
            var yNew = y2 + (anpha * (y2 - y1)) / (x2 - x1);
            return { x: xNew, y: yNew };
        }
    }
}
