function currentMouse(evt) {
    if (isMobile) {

        var x = evt.changedTouches[0].clientX,
            y = evt.changedTouches[0].clientY;
        if (window.orientation == 90 || window.orientation == -90) {
            x = evt.changedTouches[0].clientX - (screenSize.width / 2 - width / 2);
        }
        return { x: x, y: y };
    } else return { x: evt.layerX, y: evt.layerY }
}
function limitAngle(mouseangle) {
    var lbound = 8;
    var ubound = 172;
    if (mouseangle > ubound && mouseangle < 270) mouseangle = ubound;
    if (mouseangle < lbound || mouseangle >= 270) mouseangle = lbound;
    return mouseangle;
}
